import "./App.css";
import SidebarRestrictions from "./SidebarRestrictions";
import Restaurant from "./Restaurant";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>MenuMe</p>
      </header>

      <SidebarRestrictions
        expanded={"true"}
        addElementFunction={this.addElements}
      />
      <Restaurant
        name={"McDonalds"}
        location={"2140 K Street Lincoln, NE 68510"}
        imageURL={"www.fakemcdonaldsimage.com"}
        websiteURL={"www.mcdonalds.com"}
        costLevel={"low"}
        foodCategory={"American"}
      />
      <Restaurant mealTime={"breakfast"} />
    </div>
  );
}
addElements = (value) => {
  console.log(value);
};

export default App;
